How to specify the _id field with Mongoose when creating a document in MongoDB?<p>I have an app where users log in using Firebase Auth and I then store the user details in MongoDB using Mongoose. This works fine. However, the _id of each document is currently random. I would like to specify the _id field as the uid from Firebase which I am already storing separately.</p>
<p>This is my Schema:</p>
<pre><code>const UserSchema = new mongoose.Schema({
email: {
    type: String,
},
name: {
    type: String,
},
photoUrl: {
    type: String,
},
token: {
    type: String,
},
uid: {
    type: String,
},
})
</code></pre>
<p>I have tried seemingly all variations of the below but nothing seems to work:</p>
<pre><code>_id: {
    type: mongoose.Schema.Types.ObjectId,
},
</code></pre>
<p>No errors are given, just nothing gets written to Mongo (it does if I don't include the _id field). Can anyone see what I'm doing wrong, please?</p>

