How can I make my User.findByIdAndUpdate runs only after the password is set to my new password?<p>So this is my code, basically what I want to do is changing the password if the user wants to change it, otherwise, it will stay the same. Although, when I changed it does not get hashed because it automatically accepts the input from the frontend (req.body.password). It looks like the last promise does not wait for the previous to complete and get the password set to the new one.</p>
<pre><code> profileRoutes.put(&quot;/profile/:userid&quot;, (req, res) =&gt; {
  const { userid } = req.params;
  const { firstName, lastName, email, imageUrl } = req.body;
  let password = req.body.password;
  let newPassword = null;

  // We need a validation here?
  User.findById(userid)
    .then((user) =&gt; {
      console.log(&quot;user&quot;, user);
      console.log(user.password === password);

      if (user.password !== password) {
        console.log(&quot;setting the new pass&quot;);
        const salt = bcrypt.genSaltSync(10);
        newPassword = bcrypt.hashSync(password, salt);
        console.log(&quot;password:&quot;, password, &quot;newPassword:&quot;, newPassword);
        password = newPassword;
      }
    }).then(User.findByIdAndUpdate(
        userid,
        { firstName, lastName, email, imageUrl, password },
        { new: true }
      )
        .then((response) =&gt; {
          console.log(&quot;response after update&quot;, response);
          res.status(200).json({ message: `User ${userid} has been updated` });
        })
        .catch((err) =&gt; {
          console.log(err);
