<p>Mongoose schema is as follows:</p>
<pre class="lang-js prettyprint-override"><code>const UserQualificationSchema = new Schema(
    {
        user: {
            type: mongoose.Schema.Types.ObjectId,
            ref: 'User',
        },
    }
</code></pre>
<pre class="lang-js prettyprint-override"><code>const UserSchema = new Schema(
    {
        fleet: {
            type: [String], // Eg [&quot;FleetA&quot;, &quot;FleetB&quot;, &quot;FleetC&quot;]
            required: true,
        }
    }
</code></pre>
<p>I need to find all UserQualifications where an item in the user's fleet equals a value in a filter array.</p>
<p>For example:  Find all User Qualifications where <code>user.fleet: {$in: [&quot;FleetA&quot;, &quot;FleetC&quot;]}</code></p>
<p>I've looked at aggregations and querying inside <code>.populate()</code> but can't seem to get it to work.</p>
<p>Any ideas much appreciated.</p>

