      required: [true, 'Please insert your name'],
    },

    avatar: {
      type: Object,
    },

    role: {
      type: String,
      enum: ['user', 'admin'],
      default: 'user',
    },

  },
  {
    toJSON: { virtuals: true },
    toObject: { virtuals: true },
  }
);

const User = mongoose.model('User', userSchema);

module.exports = User;
